import React, { useState } from "react";
import BasicInfoStep from "./registrationSteps/BasicInfoStep";
import OperationStep from "./registrationSteps/OperationStep";
import RegistrationDocumentStep from "./registrationSteps/RegistrationDocumentStep"; // Import missing step
import { registerCBO } from "../utils/api"; // Import API function

const RegistrationForm = () => {
  const [step, setStep] = useState(1);
  const [loading, setLoading] = useState(false); // Loading state
  const [customOrg, setCustomOrg] = useState("");
  const [formData, setFormData] = useState({
    name: "",
    shortname: "",
    description: "",
    address: "",
    representation: "",
    operationDetails: {
      organization_registration: "",
      other_organization_registration: "",
      date_established: "",
      psic: "",
      target_members: "",
      number_of_members: { male: 0, female: 0 },
      annual_production: [],
      production_scope: "",
      sales_scope: "",
      total_assets: 0,
      total_liabilities: 0,
      annual_gross_income: 0,
      procurement_experience: [],
      sponsor_agency: "",
      other_sponsor_agency: "",
    },
    registrationDocuments: {
      board_resolution: null,
      registration_certificate: null,
      business_permit: null,
      bank_account_certificate: null,
      bir_certificate: null,
    },
  });

  const validateStep = () => {
    if (step === 1) {
      if (!formData.name || !formData.shortname || !formData.address || !formData.representation) {
        alert("Please fill in all required fields");
        return false;
      }
    }
    if (step === 2) {
      if (!formData.operationDetails.organization_registration) {
        alert("Please select an organization registration type");
        return false;
      }
      if (formData.operationDetails.organization_registration === "Others" && !customOrg.trim()) {
        alert("Please specify the organization type when 'Others' is selected.");
        return false;
      }
    }
    if (step === 3) {
      const { registrationDocuments } = formData;
      for (const key in registrationDocuments) {
        if (!registrationDocuments[key]) {
          alert(`Please upload ${key.replace(/_/g, " ")}`);
          return false;
        }
      }
    }
    return true;
  };
  

  const nextStep = () => {
    if (!validateStep()) return; // Ensure validation passes
  
    if (step === 2) {
      setFormData((prevData) => ({
        ...prevData,
        operationDetails: {
          ...prevData.operationDetails,
          other_organization_registration:
            prevData.operationDetails.organization_registration === "Others"
              ? customOrg.trim() || "Specify organization type"
              : "", 
        }
      }));
    }
  
    setStep(step + 1);
  };

  const prevStep = () => setStep(step - 1);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    // Ensure "Others" input is stored correctly before submission
    const finalData = {
      ...formData,
      operationDetails: {
        ...formData.operationDetails,
        organization_registration: formData.operationDetails.organization_registration,
        other_organization_registration:
          formData.operationDetails.organization_registration === "Others"
            ? formData.operationDetails.other_organization_registration || "Specify organization type"
            : "", // Ensures a value is sent if "Others" is selected
      },
    };

    try {
      const response = await registerCBO(finalData); // API call
      console.log("Server Response:", response);

      alert("Registration Successful!");
      setFormData({
        name: "",
        shortname: "",
        description: "",
        address: "",
        representation: "",
        operationDetails: {
          organization_registration: "",
          other_organization_registration: "",
          date_established: "",
          psic: "",
          target_members: "",
          number_of_members: { male: 0, female: 0 },
          annual_production: [],
          production_scope: "",
          sales_scope: "",
          total_assets: 0,
          total_liabilities: 0,
          annual_gross_income: 0,
          procurement_experience: [],
          sponsor_agency: "",
          other_sponsor_agency: "",
        },
        registrationDocuments: {
          board_resolution: null,
          registration_certificate: null,
          business_permit: null,
          bank_account_certificate: null,
          bir_certificate: null,
        },
      });
      
      setStep(1);
    } catch (error) {
      console.error("Error registering CBO:", error);
      alert("Registration Failed. Check console for details.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      {step === 1 && <BasicInfoStep formData={formData} setFormData={setFormData} />}
      {step === 2 && (
        <OperationStep
          formData={formData.operationDetails}
          setFormData={(newOperationData) =>
            setFormData({ ...formData, operationDetails: newOperationData })
          }
          customOrg={customOrg} // Pass customOrg to OperationStep
          setCustomOrg={setCustomOrg} // Pass setter to update input
        
        />
      )}
      <div>
        {step > 1 && <button type="button" onClick={prevStep}>Back</button>}
        {step < 3 && <button type="button" onClick={nextStep}>Next</button>}
        {step === 3 && (
          <button type="submit" disabled={loading}>
            {loading ? "Submitting..." : "Submit"}
          </button>
        )}
      </div>
    </form>
  );
};

export default RegistrationForm;
